import React, { useState } from 'react'
import { Typography, Card } from 'antd'

const { Title } = 'Typography'

function dialogFlow() {
    return (
        <Card bodyStyle={{ padding: '0px' }}>
            <Title>This is a Dialog Flow</Title>
        </Card>
    )
}

export default dialogFlow
